import React from "react";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navBar";

function App() {
  return (
    <React.Fragment>
      <NavBar />
      <div className="App">
        <div>Trending</div>
        <div>
          <main role="main" class="container">
            Events
          </main>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
